import React, { Component } from 'react'
import './App.css';
import BookList from './BookList';
console.log(BookList)

export default class App extends Component {
    
    render() {
        return (
            <ul>
          {BookList.map(a => <li>{`${a.title.bold()} by ${a.author}`}<br/></li>)}
            </ul>
        )
    }
}
